import React, { useEffect, useState } from "react";
import axios from "axios";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCartPlus } from "@fortawesome/free-solid-svg-icons";
import { Link } from "react-router-dom";
import ReactPaginate from "react-paginate";

const ProductList = () => {
  const [products, setProducts] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [selectedCategory, setSelectedCategory] = useState(null);
  const [pageNumber, setPageNumber] = useState(0);
  const productsPerPage = 9;
  const pagesVisited = pageNumber * productsPerPage;

  useEffect(() => {
    let url = "https://fakestoreapi.com/products";
    if (selectedCategory) {
      url += `/category/${selectedCategory}`;
    }
    axios
      .get(url)
      .then((response) => {
        setProducts(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, [selectedCategory]);

  const handleAddToCart = (productId) => {
    console.log(`Added product with ID ${productId} to cart`);
  };

  const handleCategorySelect = (category) => {
    setSelectedCategory(category);
    setPageNumber(0);
  };

  const handleSearch = async (event) => {
    event.preventDefault();
    const response = await axios.get(
      `https://fakestoreapi.com/products/category/${searchTerm}`
    );
    if (Array.isArray(response.data)) {
      setProducts(response.data);
    } else {
      setProducts([]);
    }
  };

  const pageCount = Math.ceil(products.length / productsPerPage);

  const changePage = ({ selected }) => {
    setPageNumber(selected);
  };

  return (
    <section className="section">
      <div className="container">
        <div className="buttons has-addons">
          <button
            className={`button ${
              selectedCategory === null ? "is-primary is-selected" : ""
            }`}
            onClick={() => handleCategorySelect(null)}
          >
            All
          </button>
          <button
            className={`button ${
              selectedCategory === "men clothing" ? "is-selected" : ""
            }`}
            onClick={() => handleCategorySelect("men's%20clothing")}
          >
            Men's Clothing
          </button>
          <button
            className={`button ${
              selectedCategory === "jewelery" ? "is-selected" : ""
            }`}
            onClick={() => handleCategorySelect("jewelery")}
          >
            Jewelery
          </button>
          <button
            className={`button ${
              selectedCategory === "electronics" ? "is-selected" : ""
            }`}
            onClick={() => handleCategorySelect("electronics")}
          >
            Electronics
          </button>
          <button
            className={`button ${
              selectedCategory === "women clothing" ? "is-selected" : ""
            }`}
            onClick={() => handleCategorySelect("women's%20clothing")}
          >
            Women's Clothing
          </button>
        </div>
        <div className="columns is-multiline">
          <div className="column is-3">
            <form onSubmit={handleSearch}>
              <div className="field has-addons">
                <div className="control is-expanded">
                  <input
                    className="input"
                    type="text"
                    placeholder="Search by category"
                    value={searchTerm}
                    onChange={(event) => setSearchTerm(event.target.value)}
                  />
                </div>
                <div className="control">
                  <button className="button is-info" type="submit">
                    Search
                  </button>
                </div>
              </div>
            </form>
          </div>
          {products
            .slice(pagesVisited, pagesVisited + productsPerPage)
            .map((product) => (
              <div key={product.id} className="column is-4">
                <div className="card">
                  <div className="card-image">
                    <figure className="image is-4by3">
                      <img src={product.image} alt={product.title} />
                    </figure>
                  </div>
                  <div className="card-content">
                    <p className="title is-5">{product.title}</p>
                    <p className="subtitle is-6">${product.price}</p>
                    <div className="content">{product.description}</div>
                    <button
                      className="button is-info"
                      onClick={() => handleAddToCart(product.id)}
                    >
                      <FontAwesomeIcon icon={faCartPlus} />
                      &nbsp;Add to Cart
                    </button>
                    <Link
                      to={`/product/${product.id}`}
                      className="button is-link ml-2"
                    >
                      Details
                    </Link>
                  </div>
                </div>
              </div>
            ))}
        </div>
        <ReactPaginate
          previousLabel={"<"}
          nextLabel={">"}
          pageCount={pageCount}
          onPageChange={changePage}
          containerClassName={"pagination"}
          previousClassName={"pagination-previous"}
          nextClassName={"pagination-next"}
          disabledClassName={"pagination-disabled"}
          activeClassName={"pagination-active"}
        />
      </div>
    </section>
  );
};

export default ProductList;
